int f(char c){return c<='9'?c-'0':(c<='Z'?c-'A'+10:c-'a'+36);}
int get(char *s){
	int x=f(*s++);
	x=(x<<6)|f(*s++);
	x=(x<<6)|f(*s++);
	x=(x<<6)|f(*s++);
	x=(x<<6)|f(*s);
	return x;
}
int F(int n){
	long long ans=get(pre+5*(n/u));int w=get(fac+5*(n/u));
	for (int i=n/u*u+1;i<=n;i++)w=1LL*w*i%mo,ans+=w;
	return ans%mo;
}
